import '../App/App.css'
import Switch from '@mui/material/Switch';

const App = ({visible}) => {
    return (
        
        <div className="app">
            <Switch label = 'Label' defaultChecked />

            <Header />
            <ItemAdder />
            <TodosList />
        </div>

    );
};

  

export default App;
